import React from 'react';

import "/home/kaappo/testit/canvas/src/components/numberdisplay.css";

class NumberDisplay extends React.Component {
    constructor(props) {
        super(props);

        this.props = {
            value: props.value,
            suffix: props.suffix,
            unit: props.unit
        }
    }



    render() {
        return (
            <div className="displayContainer">
                <div className="displayElement">{this.props.value}</div>
                <div className="displayElement">{this.props.suffix} </div>
                <div className="displayElement">{this.props.unit} </div>
            </div>
        );
    }
}

export default NumberDisplay;
